takip_edilen_mağaza_sayısı = 0
favoriye_eklenen_ürün_sayısı = 0
sepete_eklenen_ürün_sayısı = 0
islenen_kullanici=0
toplam_kullanici_sayisi = len(kullanici_bilgileri)

def trendyol_giris(email, sifre):
    options = Options()
    options.headless = True
    driver = webdriver.Chrome(options=options)

    try:
        driver.get("https://www.trendyol.com/en/login?cb=%2Fen")
        time.sleep(1)

        # Ülke seçimi popup'ı
        country_select = driver.find_element(By.CSS_SELECTOR, "select[data-testid='country-select']")
        country_select.click()
        time.sleep(1)
        country_option = driver.find_element(By.CSS_SELECTOR, "select[data-testid='country-select'] option[value='AE']")
        country_option.click()
        time.sleep(1)
        country_select_btn = driver.find_element(By.CSS_SELECTOR, "button[data-testid='country-select-btn']")
        country_select_btn.click()
        time.sleep(1)

        email_input = driver.find_element(By.ID, "login-email-input")
        email_input.send_keys(email)

        sifre_input = driver.find_element(By.ID, "login-password-input")
        sifre_input.send_keys(sifre)

        giris_yap_btn = driver.find_element(By.CSS_SELECTOR, "button[data-testid='login-button']")
        time.sleep(1)
        giris_yap_btn.click()
        time.sleep(1)

        return driver

    except Exception as e:
        print("Giriş yapılırken hata oluştu:", e)
        return None


def urunu_begendir(kullanici_bilgileri):
    global takip_edilen_mağaza_sayısı
    global favoriye_eklenen_ürün_sayısı
    global sepete_eklenen_ürün_sayısı
    global islenen_kullanici

    for kullanici in kullanici_bilgileri:
        email = kullanici["email"]
        sifre = kullanici["sifre"]
        driver = trendyol_giris(email, sifre)
        time.sleep(2)
        if driver:
            try:

                urun_url = "https://www.trendyol.com/en/rosmod/women-s-black-croco-leather-cat-patterned-zippered-lined-shoulder-and-hand-bag-with-inner-pocket-p-765753306?boutiqueId=61&merchantId=868857&filterOverPriceListings=false&sav=true&itemNumber=1010652105"
                driver.get(urun_url)
                time.sleep(1)
                driver.get(urun_url)
                time.sleep(1)

                # Favori butonunu kontrol et
                favori_butonu = driver.find_element(By.CSS_SELECTOR, "div[id='add-to-favorites']")

                # Favori butonunun içindeki "selected" sınıfını kontrol et
                favori_icon = favori_butonu.get_attribute("class")

                # Eğer "selected" sınıfı varsa, ürün zaten favorilere eklenmiş demektir
                if "selected" in favori_icon:
                    print("Ürün zaten favorilerde.")
                else:
                    # Favori butonuna tıkla
                    favori_butonu.click()




                time.sleep(1)

                # Sepete ekle butonunu bul
                for _ in range(1):
                    driver.get(urun_url)
                    sepete_ekle_butonu = driver.find_element(By.CSS_SELECTOR, "button[data-tracker='click:BasketImpression']")
                    sepete_ekle_butonu.click()
                    time.sleep(6)

                islenen_kullanici+=1



            except Exception as e:
                print("Ürün beğenirken veya sepete eklerken hata oluştu:", e)
            finally:
                driver.quit()

def plot_live_data():
    global takip_edilen_mağaza_sayısı
    global favoriye_eklenen_ürün_sayısı
    global sepete_eklenen_ürün_sayısı
    global islenen_kullanici

    while True:
        plt.clf()
        # Verileri bar grafiği olarak göster
        plt.bar(["Takip Edilen Mağaza", "Favoriye Eklendi", "Sepete Eklendi", "İşlenen Kullanıcı"], [takip_edilen_mağaza_sayısı, favoriye_eklenen_ürün_sayısı, sepete_eklenen_ürün_sayısı,((islenen_kullanici*100)/(toplam_kullanici_sayisi))
])
        
        plt.title("Trendyol İşlem Dağılımı")
        plt.xlabel("İşlem Türü")
        plt.ylabel("Kullanıcı Sayısı")
        plt.draw()
        plt.pause(5)

def main():
    chunk_size = 10  # Her bir iterasyonda kaç kullanıcı işlenecek
    with concurrent.futures.ThreadPoolExecutor(max_workers=1) as executor:
        for i in range(0, len(kullanici_bilgileri), chunk_size):
            chunk = kullanici_bilgileri[i:i+chunk_size]
            executor.submit(urunu_begendir, chunk)

        plot_live_data()

if __name__ == "__main__":
    main()
